import React from 'react'

class BadgesBox extends React.Component {
    state = {
        data: [
            {
                id: 1,
                name: "Exon",
                old: "19 años",
                raza: "Espectro oscuro"
              },
              {
                id: 2,
                  name: "André",
                  old: "19 años",
                  raza: "Humano"
              },
              {
                id: 3,
                  name: "Shon",
                  old: "Incierto",
                  raza: "Dragón"
              },
              {
                id: 4,
                name: "Fiona",
                old: "18 años",
                raza: "Moondana"
              },
              {
                id: 5,
                name: "Rosalinda",
                old: "17 años",
                raza: "Humana"
              },
              {
                id: 6,
                name: "Lucia",
                old: "18 años",
                raza: "Humana"
              },
              {
                id: 7,
                name: "Yane",
                old: "19 años",
                raza: "Humana"
              },
              {
                id: 8,
                name: "Jack",
                old: "18 años",
                raza: "Humano"
              }
        ]
    }
    render() {
        return (
            <div className="BadgesBox">
               <div className="BadgesBox">
               <ul className="list-unstyled">
                {this.props.badges.map(badge => {
                  return (
                    <li key={badge.id} >
                        <p>{badge.name}</p>
                    </li>
                  )
                })}
              </ul>
               </div>
            </div>
        );
    }
}

export default BadgesBox;
